import React from 'react'
import Contact from '../../Components/Contact/Contact'
import './Contact.css';

const ContactPage = () => {
  return (
    <>
        <h1 className='contact_heading'>Get in touch with us. <br />We're here to assist you.</h1>
        <Contact 
        styles={{
          border:'none'
        }}
        />
    </>
  )
}

export default ContactPage
